int fairplay_setup(const unsigned char req[16], unsigned char res[142])
{
	int mode;

	if (req[4] != 0x03) {
		/* Unsupported fairplay version */
		return -1;
	}

	mode = req[14];
	memcpy(res, reply_message[mode], 142);
	return 0;
}

int fairplay_handshake(const unsigned char req[164], unsigned char res[32])
{
	if (req[4] != 0x03) {
		/* Unsupported fairplay version */
		return -1;
	}
	//messagebuf
	memcpy(messagebuf, req, 164);
	memcpy(res, fp_header, 12);
	memcpy(res + 12, req + 144, 20);
	return 0;
}
