			http_response_add_header(res, "Connection", "Upgrade");
			respnsebuf = raop->callbacks.processairplayvideo(conn->socket_fd, conn->connectcounter, conn->remote, (char*)method, url2, (char*)data, datalen, 2, sessionid, contenttype, auth, photoAction, photoCacheId);
