static int
raop_rtp_mirror_parse_remote(raop_rtp_mirror_t* raop_rtp_mirror, const unsigned char* remote, int remotelen)
{
	char current[25];
	int family;
	int ret;
	assert(raop_rtp_mirror);
	if (remotelen == 4) {
		family = AF_INET;
	}
	else if (remotelen == 16) {
		family = AF_INET6;
	}
	else {
		return -1;
	}
	memset(current, 0, sizeof(current));
	sprintf(current, "%d.%d.%d.%d", remote[0], remote[1], remote[2], remote[3]);
	// logger_log(raop_rtp_mirror->logger, LOGGER_DEBUG, "raop_rtp_mirror_parse_remote ip = %s", current);
	ret = netutils_parse_address(family, current,
		&raop_rtp_mirror->remote_saddr,
		sizeof(raop_rtp_mirror->remote_saddr));
	if (ret < 0) {
		return -1;
	}
	raop_rtp_mirror->remote_saddr_len = ret;
	return 0;
}

