#include <stdlib.h>
#include <string.h>
#include <assert.h>



struct sdp_s {
	char* data;

	/* Actual SDP records */
	const char* version;
	const char* origin;
	const char* connection;
	const char* session;
	const char* time;
	const char* media;

	/* Additional SDP records */
	const char* rtpmap;
	const char* fmtp;
	const char* rsaaeskey;
	const char* fpaeskey;
	const char* aesiv;
	const char* min_latency;
};

static void
parse_sdp_line(sdp_t* sdp, char* line)
{
	int len = strlen(line);
	if (len < 2 || line[1] != '=') {
		return;
	}

	switch (line[0]) {
	case 'v':
		sdp->version = &line[2];
		break;
	case 'o':
		sdp->origin = &line[2];
		break;
	case 's':
		sdp->session = &line[2];
		break;
	case 'c':
		sdp->connection = &line[2];
		break;
	case 't':
		sdp->time = &line[2];
		break;
	case 'm':
		sdp->media = &line[2];
		break;
	case 'a':
	{
		char* key;
		char* value;

		/* Parse key and value */
		key = &line[2];
		value = strstr(line, ":");
		if (!value) break;
		*(value++) = '\0';

		if (!strcmp(key, "rtpmap") && !sdp->rtpmap) {
			sdp->rtpmap = value;
		}
		else if (!strcmp(key, "fmtp") && !sdp->fmtp) {
			sdp->fmtp = value;
		}
		else if (!strcmp(key, "rsaaeskey")) {
			sdp->rsaaeskey = value;
		}
		else if (!strcmp(key, "fpaeskey")) {
			sdp->fpaeskey = value;
		}
		else if (!strcmp(key, "aesiv")) {
			sdp->aesiv = value;
		}
		else if (!strcmp(key, "min-latency")) {
			sdp->min_latency = value;
		}
		break;
	}
	}
}

static void
parse_sdp_data(sdp_t* sdp)
{
	int pos, len;

	pos = 0;
	len = strlen(sdp->data);
	while (pos < len) {
		int lfpos;

		/* Find newline in string */
		for (lfpos = pos; sdp->data[lfpos]; lfpos++) {
			if (sdp->data[lfpos] == '\n') {
				break;
			}
		}
		if (sdp->data[lfpos] != '\n') {
			break;
		}

		/* Replace newline with '\0' and parse line */
		sdp->data[lfpos] = '\0';
		if (lfpos > pos && sdp->data[lfpos - 1] == '\r') {
			sdp->data[lfpos - 1] = '\0';
		}
		parse_sdp_line(sdp, sdp->data + pos);
		pos = lfpos + 1;
	}
}

sdp_t*
sdp_init(const char* sdpdata, int sdpdatalen)
{
	sdp_t* sdp;

	sdp = (sdp_t * )calloc(1, sizeof(sdp_t));
	if (!sdp) {
		return NULL;
	}

	/* Allocate data buffer */
	sdp->data = (char*)malloc(sdpdatalen + 1);
	if (!sdp->data) {
		free(sdp);
		return NULL;
	}
	memcpy(sdp->data, sdpdata, sdpdatalen);
	sdp->data[sdpdatalen] = '\0';
	parse_sdp_data(sdp);
	return sdp;
}

void
sdp_destroy(sdp_t* sdp)
{
	if (sdp) {
		free(sdp->data);
		free(sdp);
	}
}

